export const Popular = () => {
  

  return (
    <div className="popular">
      <h1>LATEST COLLECTION</h1>
      <hr />
      <div className="popular-item">
        {(newCollection.length > 0 ? newCollection : data_product).map((item, i) => (
          <Item
            key={i}
            id={item.id}
            name={item.name}
            image={item.image}
            new_price={item.new_price}
            old_price={item.old_price}
          />
        ))}
      </div>
    </div>
  );
};
